    render(){
        return(
            <Pageadmin>
                <Row>
                    <Col sm='3'>
                    </Col>
                    <Col sm='9'>
                    </Col>
                </Row>
            </Pageadmin>
        )
    }
}


export default ListLaporanAnalisa;
